package com.core;

public class RelationalOperatorsProgram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a=10;
int b=5;
int c=40;
int d=56;
int e=10;
int f=32;
System.out.println(a>b); //10>5  true
System.out.println(a>d);//false
System.out.println(e<f);//10<32 true
System.out.println(c>=a); //40>=10  true
System.out.println(c<=d); //40<=56 true
System.out.println(a!=b);//true
System.out.println(a==e); //true
System.out.println(a==d);//false

	}

}
